def protein_encoder(protein_string):

	base_code = {
					'R' : 0,
					'K' : 0,
					'G' : 1,
					'Q' : 1,
					'S' : 1,
					'N' : 1,
					'T' : 1,
					'H' : 1,
					'Y' : 1,
					'A' : 2,
					'V' : 2,
					'L' : 2,
					'I' : 2,
					'P' : 2,
					'M' : 2,
					'C' : 2,
					'W' : 3,
					'F' : 3,
					'D' : 4,
					'E' : 4,		
				}

	seq = []

	for aa in protein_string.upper():

		try:
			seq.append(base_code[aa])
		except:
			seq.append(aa)

	return seq

def rna_encoder(rna_string):

	base_code = {
					'A' : 0,
					'a' : 0,
					'U' : 1,
					'u' : 1,
					'T' : 1,
					't' : 1,
					'G' : 2,
					'g' : 2,
					'C' : 3,
					'c' : 3,
				}

	seq = []

	for nu in rna_string:

		try:
			seq.append(base_code[nu])
		except:
			seq.append(nu)

	return seq

def protein_features(protein):

	feature_vector = [0.0] * (5**5)

	for i in range(len(protein) - 4):

		try:
			feature_vector[int("".join(map(str,protein[i:i+5])),5)] += 1.0

		except:
			pass

	minval = min(feature_vector)
	maxval = max(feature_vector)

	return [str((feature - minval) / maxval) for feature in feature_vector]

def rna_features(rna):

	feature_vector = [0.0] * (4**5)

	for i in range(len(rna) - 5 + 1):

		try:
			feature_vector[int("".join(map(str,rna[i:i+5])),4)] += 1.0			

		except:
			pass
		
	minval = min(feature_vector)
	maxval = max(feature_vector)

	return [str((feature - minval) / maxval) for feature in feature_vector]

def features(protein, rna):

	encoded_rna = rna_encoder(rna)
	encoded_protein = protein_encoder(protein)

	protein_vector = protein_features(encoded_protein)
	rna_vector = rna_features(encoded_rna)

	return np.array(protein_vector + rna_vector, dtype = np.float32).reshape(1,-1)

